const UPLOAD_CONTACTS = "UPLOAD_CONTACTS";

const navBarReducer = (state, action) => {
	
		if (action.type === UPLOAD_CONTACTS) {
			state.navBar = state.contactArr;
		}

	return state;
}

export default navBarReducer;
